// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/AccessControlEnumerable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./IERC721Royalty.sol";

contract LemonadeMarketplace is AccessControlEnumerable, Pausable {
    using Counters for Counters.Counter;

    bytes32 public constant PAUSER_ROLE = keccak256("PAUSER_ROLE");

    Counters.Counter private _orderIdTracker;

    enum OrderKind { Direct, Auction }

    event OrderCreated(uint256 indexed orderId, OrderKind kind, uint256 openFrom, uint256 openTo, address indexed maker, address currency, uint256 price, address tokenContract, uint256 tokenId);
    event OrderBid(uint256 indexed orderId, address indexed bidder, uint256 bidAmount);
    event OrderFilled(uint256 indexed orderId, address indexed taker, uint256 paidAmount);
    event OrderCancelled(uint256 indexed orderId);

    struct Order {
        OrderKind kind;
        bool open;
        uint256 openFrom;
        uint256 openTo;
        address maker;
        address currency;
        uint256 price;
        address tokenContract;
        uint256 tokenId;
        address bidder;
        uint256 bidAmount;
        address taker;
        uint256 paidAmount;
    }
    mapping (uint256 => Order) private _orders;

    constructor() {
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(PAUSER_ROLE, _msgSender());
    }

    function order(uint256 orderId)
        public
        virtual
        view
        whenExists(orderId)
        returns (OrderKind, bool, uint, uint, address, address, uint256, uint256, address, uint256)
    {
        Order memory _order = _orders[orderId];
        return (_order.kind, _order.open, _order.openFrom, _order.openTo, _order.maker, _order.currency, _order.price, _order.bidAmount, _order.taker, _order.paidAmount);
    }

    function token(uint256 orderId)
        public
        virtual
        view
        whenExists(orderId)
        returns (address, uint256)
    {
        Order memory _order = _orders[orderId];
        return (_order.tokenContract, _order.tokenId);
    }

    function createOrder(OrderKind kind, uint openFrom, uint openTo, address currency, uint256 price, address tokenContract, uint256 tokenId)
        public
        virtual
        whenNotPaused
        returns (uint256)
    {
        IERC721(tokenContract).transferFrom(_msgSender(), address(this), tokenId);

        uint256 orderId = _orderIdTracker.current();

        _orders[orderId] = Order({
            kind: kind,
            open: true,
            openFrom: openFrom,
            openTo: openTo,
            maker: _msgSender(),
            currency: currency,
            price: price,
            tokenContract: tokenContract,
            tokenId: tokenId,
            bidder: address(0),
            bidAmount: 0,
            taker: address(0),
            paidAmount: 0
        });

        _orderIdTracker.increment();

        Order memory _order = _orders[orderId];
        emit OrderCreated(orderId, _order.kind, _order.openFrom, _order.openTo, _order.maker, _order.currency, _order.price, _order.tokenContract, _order.tokenId);
        return orderId;
    }

    function cancelOrder(uint256 orderId)
        public
        virtual
        whenNotPaused
        whenExists(orderId)
    {
        Order memory _order = _orders[orderId];
        require(_order.maker == _msgSender() || hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "LemonadeMarketplace: must be the maker to cancel");
        require(_order.open, "LemonadeMarketplace: order must be open to cancel");
        require(_order.bidder == address(0), "LemonadeMarketplace: order must have no bid to cancel");

        IERC721(_order.tokenContract).safeTransferFrom(address(this), _order.maker, _order.tokenId);

        _orders[orderId].open = false;
        emit OrderCancelled(orderId);
    }

    function bidOrder(uint256 orderId, uint256 amount)
        public
        virtual
        whenNotPaused
        whenExists(orderId)
    {
        Order memory _order = _orders[orderId];
        require(_order.kind == OrderKind.Auction, "LemonadeMarketplace: order must be of kind auction to bid");
        require(_order.open, "LemonadeMarketplace: order must be open to bid");
        require(_order.openFrom == 0 || block.timestamp >= _order.openFrom, "LemonadeMarketplace: order must be open to bid - too early");
        require(_order.openTo == 0 || block.timestamp < _order.openTo, "LemonadeMarketplace: order must be open to bid - too late");
        require(_order.price <= amount, "LemonadeMarketplace: must match price to bid");

        if (_order.bidder != address(0)) {
            require(_order.bidAmount < amount, "LemonadeMarketplace: must surpass bid to bid");

            transferERC20(_order.currency, address(this), _order.bidder, _order.bidAmount);
        }

        _orders[orderId].bidder = _msgSender();
        _orders[orderId].bidAmount = amount;
        _order = _orders[orderId];

        transferERC20(_order.currency, _order.bidder, address(this), _order.bidAmount);

        emit OrderBid(orderId, _order.bidder, _order.bidAmount);
    }

    function fillOrder(uint256 orderId, uint256 amount)
        public
        virtual
        whenNotPaused
        whenExists(orderId)
    {
        Order memory _order = _orders[orderId];
        require(_order.open, "LemonadeMarketplace: order must be open to fill");

        _orders[orderId].open = false;
        address _spender;

        if (_order.kind == OrderKind.Direct) {
            require(_order.price <= amount, "LemonadeMarketplace: must match price to fill direct order");

            _orders[orderId].taker = _msgSender();
            _orders[orderId].paidAmount = amount;
            _spender = _msgSender();
        } else if (_order.kind == OrderKind.Auction) {
            require(_order.maker == _msgSender() || hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "LemonadeMarketplace: must be the maker to fill auction order");
            require(_order.bidder != address(0), "LemonadeMarketplace: order must have bid to fill auction order");

            _orders[orderId].taker = _order.bidder;
            _orders[orderId].paidAmount = _order.bidAmount;
            _spender = address(this);
        }

        _order = _orders[orderId];

        if (_order.paidAmount > 0) {
            uint256 transferAmount = _order.paidAmount;

            try IERC721Royalty(_order.tokenContract).royalty(_order.tokenId) returns (address maker, uint256 fraction) {
                if (_order.maker != maker) {
                    uint256 royalty = transferAmount * fraction / 10 ** 18;

                    transferERC20(_order.currency, _spender, maker, royalty);
                    transferAmount -= royalty;
                }
            } catch { }

            if (transferAmount > 0) {
                transferERC20(_order.currency, _spender, _order.maker, transferAmount);
            }
        }

        IERC721(_order.tokenContract).safeTransferFrom(address(this), _order.taker, _order.tokenId);

        emit OrderFilled(orderId, _order.taker, _order.paidAmount);
    }

    function transferERC20(address _currency, address spender, address recipient, uint256 amount)
        private
        whenNotPaused
    {
        IERC20 currency = IERC20(_currency);

        if (spender == address(this)) {
            currency.transfer(recipient, amount);
        } else {
            currency.transferFrom(spender, recipient, amount); // requires allowance
        }
    }

    modifier whenExists(uint256 orderId) {
        require(_orders[orderId].maker != address(0), "LemonadeMarketplace: order nonexistent");
        _;
    }

    function pause()
        public
        virtual
    {
        require(hasRole(PAUSER_ROLE, _msgSender()), "LemonadeMarketplace: must have pauser role to pause");
        _pause();
    }

    function unpause()
        public
        virtual
    {
        require(hasRole(PAUSER_ROLE, _msgSender()), "LemonadeMarketplace: must have pauser role to unpause");
        _unpause();
    }
}
